script: |
  super -f text -I q1249.spq | sort > q1249.out

inputs:
  - name: q1249.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE NOT - - col0 BETWEEN + col1 - + col1 AND + col2 * + - 73 - - 93 - + col0;
  - name: tab1

outputs:
  - name: q1249.out
    data: |
      51	14	96
      85	5	59
      91	47	68
